export default function HomePage(){

    function scrollToBlog() {
        const blogSection = document.getElementById('Blog');
        if (blogSection) {
            blogSection.scrollIntoView({ behavior: 'smooth' });
        }
    }


    return(
        <div>
            <div className='Hero'>
                <div id='Thing'>
                    <h1><a href='#' onClick={scrollToBlog}>Thing</a></h1>
                </div>
            </div>

            <div className='Blog'>

            </div>
        </div>


    );
}
